import { Currency } from './currency';
/**
 * The exchange rate of a pair of currencies
 * @export
 * @interface ExchangeRatePairs
 */
export interface ExchangeRatePairs {
    [key: string]: any;
    /**
     *
     * @type {Currency}
     * @memberof ExchangeRatePairs
     */
    'src'?: Currency;
    /**
     *
     * @type {Currency}
     * @memberof ExchangeRatePairs
     */
    'dst'?: Currency;
    /**
     *
     * @type {number}
     * @memberof ExchangeRatePairs
     */
    'exchange_rate'?: number;
}
